import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';
import axios from 'axios'
import AddContactDialog from './AddContactDialog'
const CONTACTS_REST_API_URL = 'http://localhost:8080/api/';


const useStyles = makeStyles({
  table: {
    minWidth: 650,
  },
});


export default function ContactTable({rows, openEdit}) {
  const classes = useStyles();



  // let meh =axios.get(CONTACTS_REST_API_URL + 'getcontacts/12123')
  //   .then(function (response) {
  //     console.log(response);
  //     rows = response.data;
  //     console.log(rows)
  //   })
  //   .catch(function (error) {
  //     console.log(error);
  //   });
  // console.log(meh);
  const openEditDialog = (row)=>{
    console.log(row);
    openEdit(row)


  }



  return (
    <TableContainer component={Paper}>
      <Table className={classes.table} aria-label="simple table">
        <TableHead>
          <TableRow>
            <TableCell align="right">Last Name</TableCell>
            <TableCell align="right">First Name</TableCell>
            <TableCell align="right">Number</TableCell>
            <TableCell align="right">Address</TableCell>
            <TableCell align="right">Email</TableCell>

          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map((row) => (
            <TableRow key={row.id} onClick={()=>openEditDialog(row)}>
              <TableCell align="right">{row.lastName}</TableCell>
              <TableCell align="right">{row.firstName}</TableCell>
              <TableCell align="right">{row.phoneNumber}</TableCell>
              <TableCell align="right">{row.address}</TableCell>
              <TableCell align="right">{row.email}</TableCell>

            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
}
